import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import "./index.css";
import HomePage from "./HomePage";
import BuyPage from "./BuyPage";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/buy" element={<BuyPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
